    const ouvrir = () => {
        setOuvre(true);
    }

    const fermer = () => {
        setOuvre(false);
    }

    console.log(ouvre)

    return (
        <div>
            <div>
                <h3 className="dashboard_text" onClick={ouvrir}> Voir personnels </h3>
                <p className="dashboard_text">Créer</p>
                <p className="dashboard_text">Modifier</p>
                <p className="dashboard_text" onClick={fermer}>Supprimer</p>
            </div>
            <div>
                <CreationPersonnels />
            </div>
        </div>
    );
};

export default DashboardAdminPersonnels;
